import './Hello_function.css';
import 'tachyons';

const Hello_Function = (props) => {
		return (
		<div className="f4 tc">
			<h1>Hello_Function</h1>
			<p>Welcome to React</p>
			<p>Para = {props.greeting}</p>
		</div>
		);
}

export default Hello_Function;
